Mongo $set removing other fields in object on update<p>I am working on a mongo statement for adding and updating values into an object within my document.</p>

<p>Here is my current statement. field and value changes depending what is getting passed in: </p>

<pre><code> db.collection.update(id, {
   $set: {
     analysis : {[field]: value}
    }
  });
</code></pre>

<p>Here is an example of what a document could look like(there are potentially 20+ fields in analysis)</p>

<pre><code>{
 _id
 analysis:{
  interest_rate: 22
  sales_cost: 4000
  value: 300
 }
}
</code></pre>

<p>The problem is that every time I update the object all fields are removed except the the field I updated. </p>

<p>so if </p>

<blockquote>
  <p>field = interest_rate</p>
</blockquote>

<p>and the new </p>

<blockquote>
  <p>value = 33</p>
